using System;
using System.Collections.Generic;
using System.Text;
using NUnit.Framework;

namespace HackerRank.Tests
{
    public class ValidStringTests
    {
        [TestCase("abcc", "YES")]
        [TestCase("abccc", "NO")]
        [TestCase("aabbcd", "NO")]
        [TestCase("abcdefghhgfedecba", "YES")]
        [TestCase("", "YES")]
        [TestCase("", "YES")]
        public void TestValidString(string s, string expected)
        {
            var result = Anagrams.validString(s);
            Assert.AreEqual(expected, result);
        }
    }
}
